export default date => {
  const months = [
    'january',
    'febuary',
    'march',
    'april',
    'may',
    'june',
    'july',
    'august',
    'september',
    'october',
    'november',
    'december'
  ];
  const splitDate = date.split('-');
  const month = Math.floor(splitDate[1]);
  return `${months[month]} ${splitDate[2]} ${splitDate[0]} ${splitDate[1]} `;
};
